import { useNavigate } from "react-router-dom";
function Home(){
    const navigate=useNavigate()
    const Change=()=>{
        navigate("/home")
    }
    return(
        <div>
            <h3>This is home page</h3>
            <button onClick={Change}>go back</button> 
        </div>
    )
    

}
export default Home;
